	add("diaphoneme", "{\"term\":\"diaphoneme\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|dia|phoneme|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An unit that represents collectively the dialectal variants of a\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"represents the \u0027\u0027diaphoneme\u0027\u0027 descended from the ancestral phoneme , which is realised as in and as in lang\u003den\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1980\u0027\u0027, S. Noble \u0026amp; w:Joshua J.A. Fishman (), M. Weinrich (), P. Glasser (), \u0027History of the Yiddish Language\u0027 II (2008), vii, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dnNpXzP8z040C\u0026amp;pg\u003dPA467\u0026amp;lpg\u003dPA467\u0026amp;dq\u003ddiaphoneme\u0026amp;source\u003dbl\u0026amp;ots\u003d6PKmlUD5Di\u0026amp;sig\u003dBmItJMBOC79FC2UvuA25tEhTlk0\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dE68MU9WcNMS47QaE_YDgCw\u0026amp;ved\u003d0CFsQ6AEwB\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003ddiaphoneme\u0026amp;f\u003dfalse 467]\u0026lt;/span\u0026gt;[http://books.google.co.uk/books?id\u003dnNpXzP8z040C\u0026amp;pg\u003dPA468\u0026amp;lpg\u003dPA468\u0026amp;dq\u003ddiaphoneme\u0026amp;source\u003dbl\u0026amp;ots\u003d6PKmlUD5Di\u0026amp;sig\u003dBmItJMBOC79FC2UvuA25tEhTlk0\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dE68MU9WcNMS47QaE_YDgCw\u0026amp;ved\u003d0CFsQ6AEwB\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003ddiaphoneme\u0026amp;f\u003dfalse f\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The series with the long \u0027a\u0027 as a point of departure…today has the \u0027\u0027diaphoneme\u0027\u0027 , and to be exhaustive the \u0027\u0027diaphoneme\u0027\u0027 should be rendered , for in western Yiddish there are also the articulations and \u0026lt;!-- page break here in the source --\u0026gt; (sleep). From the point of departure of long \u0027e\u0027 (Early Vowel E₂) Yiddish arrived at the \u0027\u0027diaphoneme\u0027\u0027 , for example in \u0027veynik\u0027 (little) (cf. MHG \u0027wênic\u0027). In \u0027groys\u0027 (big; Early Vowel O₂) (cf. MHG \u0027groȥ\u0027), Yiddish has the \u0027\u0027diaphoneme\u0027\u0027 ; with the variant of Samogitia–Latvia (7.35), the symbolization will become still more complicated\", \"priority\":6}]}, \"synonyms\":{}}");

	add("diaphragm", "{\"term\":\"diaphragm\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027lang\u003dgrc|διάφραγμα\u0027 () from \u0027διά\u0027 (across) and \u0027φράγμα|lang\u003dgrc\u0027 () from the verb {{m|grc|φράσσω}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"In mammals, a sheet of muscle separating the thorax from the abdomen, contracted and relaxed in respiration to draw air into and expel air from the lungs; also called thoracic diaphragm\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any of various membranes or sheets of muscle or ligament which separate one cavity from another\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A contraceptive device consisting of a flexible cup, used to cover the cervix during intercourse\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A flexible membrane separating two chambers and fixed around its periphery that distends into one or other chamber as the difference in the pressure in the chambers varies\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"In a speaker, the thin, semi-rigid membrane which vibrates to produce sound\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A thin opaque structure with a central aperture, used to limit the passage of light into a camera or similar device\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A permeable or semipermeable membran\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A floor slab, metal wall panel, roof panel or the like, havig a sufficiently large in-plane shear stiffness and sufficient strength to transmit horizontal forces to resisting The thoracic \u0027\u0027diaphragm\u0027\u0027.Image:Contraception A contraceptive \u0027\u0027diaphragm\u0027\u0027.Image:Seal A mechanical \u0027\u0027diaphragm\u0027\u0027.Image:X5 Paper Pulp An acoustic \u0027\u0027diaphragm\u0027\u0027.\u0026lt;/gallery\u0026gt\", \"priority\":8}]}, \"synonyms\":{}}");

	add("diapir", "{\"term\":\"diapir\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027διαπειραίνω\u0027 (to pierce through)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An intrusion of a ductile rock into an overburden\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1989\u0027\u0027, Nigel Henbest, \u0026quot;[http://books.google.com/books?id\u003dCLYbUQlpb-kC\u0026amp;pg\u003dPA35\u0026amp;dq\u003d%22diapir Geologists hit back at impact theory of extinctions]\u0026quot;, \u0027New Scientist\u0027, 29 April 1989\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;If a \u0027\u0027diapir\u0027\u0027 is outside an established plume it rises at a much slower rate,\u0026quot; Loper says\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, Peter Olson, \u0026quot;Mechanics of Flood Basalt Magmatism\u0026quot;, in \u0027Magmatic Systems\u0027 (ed. Michael P. Ryan), Academic Press (1994), ISBN 0126050708, [http://books.google.com/books?id\u003dc4ONWE2UWccC\u0026amp;pg\u003dPA12 page 12\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"This final stage is characterized by the cooling and resolidification of the partially molten \u0027\u0027diapir\u0027\u0027 within the mantle, slow subsidence at the surface, and greatly diminished rates of crustal addition\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, \u0027The Earth: An Intimate History\u0027, HarperCollins (2010), ISBN 9780007373338, [http://books.google.com/books?id\u003dQS3D0Pp9l9IC\u0026amp;pg\u003dPT197 unnumbered page\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Deeply buried deposits of sea-salt dome upwards and pass through the overlying strata, as a kind of intrusive lobe, eventually emerging at the surface – the rising tongue is called a \u0027\u0027diapir\", \"priority\":7}]}, \"synonyms\":{}}");

	add("diary", "{\"term\":\"diary\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin {{m|la|diārium||a daily allowance for soldiers, also a diary}}, neuter of * {{m|la||diarius}}, from {{m|la|dies||a day}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A daily log of experiences, especially those of the writer\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The method or media used to keep such experiences\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"They kept separate \u0027\u0027diaries\u0027\u0027. His was on paper and her \u0027\u0027diary\u0027\u0027 was on her computer\u0027s hard drive\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A calendar or appointment book\", \"priority\":4}]}, \"synonyms\":{}}");

	add("diarchy", "{\"term\":\"diarchy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|di|archy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A form of government where power is shared between two joint authorities\", \"priority\":1}]}, \"synonyms\":{}}");

	add("diarist", "{\"term\":\"diarist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|diary|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who keeps a diary\", \"priority\":1}]}, \"synonyms\":{}}");

	add("diarrhea", "{\"term\":\"diarrhea\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"middle french (ca. 1400-1600)\", \"ancient greek (to 1453)\"], \"text\":\"From Middle french (ca. 1400-1600) {{m|frm|diarrie}} (French {{m|fr|diarrhée}}), from {{m|la|diarrhoea}}, from Ancient greek (to 1453) {{m|grc|διάρροια||through-flowing}}, from {{m|grc|διά||through}} + {{m|grc|ῥέω||flow}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A condition in which the sufferer has frequent and watery bowel movements\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The watery excrement that comes from such bowel movements\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Danna Korn and Connie Sarros, Gluten-Free Cooking for Dummies, [https://books.google.com/books?id\u003dj1aJ2vx0Ig0C\u0026amp;lpg\u003dPP33\u0026amp;dq\u003d%22covered%20in%20diarrhea%22\u0026amp;pg\u003dPP3\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22covered%20in%20diarrhea%22\u0026amp;f\u003dfalse Chapter 1\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"My Pampers bill is higher than your paycheck, my hands are raw from washing them every six minutes, and I do eight loads of laundry a day because everything we own is covered in \u0027\u0027diarrhea\u0027\u0027, and you want me to \u0026quot;plug him up\u0026quot; and wait another three weeks\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Daniel Everett, \u0027Don\u0027t Sleep, There Are Snakes\u0027, [https://books.google.com/books?id\u003diQV9l-s7y2IC\u0026amp;lpg\u003dPA47\u0026amp;dq\u003d%22covered%20in%20diarrhea%22\u0026amp;pg\u003dPA4\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22covered%20in%20diarrhea%22\u0026amp;f\u003dfalse page 47\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"I looked and saw that she and her hammock were covered in \u0027\u0027diarrhea\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2014\u0027\u0027, L. A. Knight, \u0027Dog Training the American Male\u0027, [https://books.google.com/books?id\u003dC_TDBAAAQBAJ\u0026amp;lpg\u003dPA221\u0026amp;dq\u003d%22covered%20in%20diarrhea%22\u0026amp;pg\u003dPA22\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22covered%20in%20diarrhea%22\u0026amp;f\u003dfalse 221\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Why was she covered in \u0027\u0027diarrhea\", \"priority\":11}]}, \"synonyms\":{}}");

	add("diarylquinoline", "{\"term\":\"diarylquinoline\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|diaryl|quinoline|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A quinoline containing two aryl group\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027diarylquinolines\u0027\u0027 have a bactericidal effect\", \"priority\":2}]}, \"synonyms\":{}}");

	add("diastema", "{\"term\":\"diastema\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From from Ancient greek (to 1453) \u0027διάστημα \u0027 (interval, space between) Compare \u0027diastasis\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A gap or space between two adjacent teeth, especially the upper front incisors (in humans). In other species, a diastema refers to a gap between teeth of different types, e.g. incisors and molars, which is a feature of some rodents and ungulates\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1968\u0027\u0027, Anthony Burgess, \u0027Enderby Outside\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A gormless-looking boy, thin and exhibiting \u0027\u0027diastemata\u0027\u0027 in the shop-front lights, offered him English newspapers\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"In pathology, a diastema may refer to any abnormal space, fissure, or cleft in an organ or part of the body\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"In cell biology, the diastema is the modified protoplasm at the equator of a cell, existing before mitotic division\", \"priority\":5}]}, \"synonyms\":{}}");

	add("diathermy", "{\"term\":\"diathermy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|dia|thermy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The generation of heat using high-frequency electromagnetic currents; especially the therapeutic production of heat in tissues in order to form coagulation\", \"priority\":1}]}, \"synonyms\":{}}");

	add("diatom", "{\"term\":\"diatom\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027διά\u0027 (through) + \u0027τέμνειν\u0027 (to cut) i.e., \u0026quot;cut in half\u0026quot;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A group of minute unicellular algae having a siliceous covering of great delicacy, now categorized as class \u0027\u0027 or division Bacillariophyta, formerly all included in the order \u0027\u0027, now obsolete\", \"priority\":1}]}, \"synonyms\":{}}");

	add("diatribe", "{\"term\":\"diatribe\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"First attested 1581, from French \u0027diatribe\u0027 from Latin \u0027diatriba\u0027 (learned discussion or discourse) from Ancient greek (to 1453) \u0027διατριβή\u0027 (way of spending time, lecture) from \u0027διά\u0027 (through) + \u0027τρίβω\u0027 (i waste, wear out)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An abusive, bitter, attack, or criticism: denunciation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A prolonged discourse\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A speech or writing which bitterly denounces something\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The senator was prone to \u0027\u0027diatribes\u0027\u0027 which could go on for more than an hour\", \"priority\":4}]}, \"synonyms\":{}}");

	add("diazepine", "{\"term\":\"diazepine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|di|azepine|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A seven-membered unsaturated heterocycle having two nitrogen atoms and three double bonds; any derivative of this compound\", \"priority\":1}]}, \"synonyms\":{}}");

	add("diazole", "{\"term\":\"diazole\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|di|azole|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Either of two unsaturated heterocycles consisting of a five-membered ring containg three carbon atoms, two nitrogen atoms and two double bonds - namely pyrazole and imidazole\", \"priority\":1}]}, \"synonyms\":{}}");

